const ROOT_URL = "https://frebi.willandskill.eu/"

export default class {
  login = () => {
    console.log("logging in")
  }
  async activateUser() {}
  async register(user) {
    const url = `${ROOT_URL}auth/users/`
    const payload = user
    console.log(user)
    return fetch(url, {
      method: "POST",
      headers: this.getPublicHeaders(),
      body: JSON.stringify(payload),
    })
  }

  getPublicHeaders() {
    return {
      "Content-Type": "application/json",
    }
  }
}
